// Pathfinding
var graph = new Graph(worldArray, {diagonal: true});

// Converts coordinates into curve
function pathToCurve(pathData){
  var colors = ['orange', 'red', 'blue', 'white', 'cyan', 'yellow', 'green'];
  var curveParameter = ['M', [pathData[0].x-90, pathData[0].y-360]];
  for(var i=1; i<pathData.length; i++){
    curveParameter.push('L', [pathData[i].x-90, pathData[i].y-360]);
  }
  var pathCurve = L.curve(curveParameter, {animate: 1500, color:colors[Math.floor(Math.random()*colors.length)],fill:false});
  pathCurve.addTo(map);
  return pathCurve;
}

// Gets closest 1's index on Array
function closestSeaIndex(i, j){
  var flag = false;
  var counter = 1;

  if(worldArray[i][j] == 1){
    return [i, j];
  }
  while(!flag){
    if(i+counter < worldArray.length && worldArray[i+counter][j] == 1){
      return [i+counter, j];
    }
    else if(i-counter >= 0 && worldArray[i-counter][j] == 1){
      return [i-counter, j];
    }
    else if(j+counter < worldArray[0].length && worldArray[i][j+counter] == 1){
      return [i, j+counter];
    }
    else if(j-counter >= 0 && worldArray[i][j-counter] == 1){
      return [i, j-counter];
    }
  }
}

// Converts coordinates to index
function getIndexOfCordinate(coor){
  return [Math.round(coor[0])+90, Math.round(coor[1])+360];
}

// Returns route's array
function getRoute(start, end){
  var startIndex = getIndexOfCordinate(start);
  var endIndex = getIndexOfCordinate(end);
  console.log(graph.grid[startIndex[0]][startIndex[1]]);
  return astar.search(graph, graph.grid[startIndex[0]][startIndex[1]], graph.grid[endIndex[0]][endIndex[1]]);
}

// Returns route's curve
function getCurve(start, end){
  var pathData = getRoute(start, end);
  var colors = ['orange', 'red', 'blue', 'white', 'cyan', 'yellow', 'green'];
  var curveParameter = ['M', [pathData[0].x-90, pathData[0].y-360]];
  for(var i=1; i<pathData.length; i++){
    curveParameter.push('L', [pathData[i].x-90, pathData[i].y-360]);
  }
  var pathCurve = L.curve(curveParameter, {animate: 1500, color:colors[Math.floor(Math.random()*colors.length)],fill:false});
  return pathCurve;
}

L.pathCurve = function(start,end){
  return new getCurve(start, end);
}
